const Header = (folderInfo) => {
  <>
    <div className="">
      <div className="profile">
        <img
          className="profile-img"
          src={folderinfo?.owner?.prfileImageSource}
          alt="프로필이미지"
        />
        <div className="profile-author">@{folderinfo?.owner?.name}</div>
        <h2 className="profile-title">{folderinfo?.name}</h2>
        {lodigError && <div>{loadingError.message}</div>}
      </div>
    </div>
  </>;
};

export default Header;
